  [],\n\t\"num_tags\": 3,\n\t\"name\": \"electrochemical-capacitor-development-for-pulsed-power-communications-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This SBIR Phase I addresses the development
  of electrochemical ultracapacitors (ECs) using graphitic nanosheets as the electrode
  material. The advantages Eltron's technology will be the reduction of device size
  due to superior power densities and relative powers. These materials also display
  reduced discharge response times compared to state of the art materials; this is
  advantageous for pulsed power applications such as burst communications and flash
  LIDAR. Eltron's carbon nanostructures are highly conductive and offer an ordered
  mesopore network. These attributes will provide more complete electrolyte wetting,
  and faster release of stored charge compared to activated carbon.rnPreliminary studies
  have shown that Eltron's materials meet or exceed the performance of major EC manufacturers.
  The Phase I objectives will be to further increase performance with regards to high
  power/short duration demands.  The technology is currently at a TRL 3 and we expect
  to reach a TRL 4 by the end of Phase I.  In Phase II studies we will optimize the
  materials' performance and scale up prototype cells and validate performance in
  critical test environments.rn\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
